import React, { Component, useState } from "react";
import "../styles/Form.scss";

class Form extends Component {




  render() {
    return (
      <div id="Form">
        <form>
          <input type="file" name="fileName" />
          <input type="button" value="Submit" onClick={this.upload.bind(this)} />
        </form>
      </div>
    );
  }
}



export default Form;
